import React from 'react'
import { useHistory } from 'react-router'

const LogOut = () => {

    let history = useHistory()

    const logOut = () => {
        localStorage.removeItem("token");
        history.push("")

    }

    return (
        <div>
            <button onClick={logOut}>Log out</button>
        </div>
    )
}

export default LogOut
